script: |
  super -f text -I q2304.spq | sort > q2304.out

inputs:
  - name: q2304.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE ( col0 + - col0 + - + ( 59 ) * ( - 23 + col0 ) NOT BETWEEN ( 51 + col0 ) AND col0 + + col1 );
  - name: tab2

outputs:
  - name: q2304.out
    data: |
      46	51	23
      64	77	40
      75	67	58
